/*pragma solidity 0.6.2;*/
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20Detailed.sol";

contract AggieCoin is ERC20, ERC20Detailed {
    constructor(uint256 initialSupply) ERC20Detailed("AggieCoin", "AC", 18) public {
        _mint(msg.sender, initialSupply);
    }
}

contract Debitable {
// Bank instance
struct Bank {
uint id;
uint bank_account;
uint cash;
}
// Read/write account
mapping(uint => Bank) public accounts;
// Store Candidates Count
uint public candidatesCount;
constructor () public {
balances(500, 500);
balances(500, 500);
//addCandidate("Candidate 1");
//addCandidate("Candidate 2");
}
function balances (uint bank_account, uint cash) public {
candidatesCount ++;
accounts[candidatesCount] = Bank(candidatesCount, bank_account, cash);
}
}
